import React, { useState, useEffect, useRef } from "react";
import L from "leaflet";
import "leaflet-draw";
import "leaflet/dist/leaflet.css";
import "leaflet-draw/dist/leaflet.draw.css";
import Map from "./Map";
import "./ZoneBuilder.css";

const ZoneBuilder = () => {
    const [maps, setMaps] = useState([]);
    const [zones, setZones] = useState([]);
    const [parentZones, setParentZones] = useState([]);  // âœ… Fix: Add Parent Zones
    const [selectedMapId, setSelectedMapId] = useState(null);
    const [selectedZoneType, setSelectedZoneType] = useState(null);
    const [selectedParentZone, setSelectedParentZone] = useState(null);
    const [zoneName, setZoneName] = useState("");
    const [useLeaflet, setUseLeaflet] = useState(false);
    const mapRef = useRef(null);
    const drawnItems = useRef(new L.FeatureGroup());

    // âœ… Fetch maps
    useEffect(() => {
        fetch("/zonebuilder/get_maps")  // ðŸ”¥ Change from `/maps/get_maps`
            .then(response => response.json())
            .then(data => setMaps(data.maps))  // âœ… Fix: Correct data parsing
            .catch(error => console.error("Error fetching maps:", error));

        fetch("/zonebuilder/get_zone_types")  // ðŸ”¥ Change from `/api/get_zone_types`
            .then(response => response.json())
            .then(data => setZones(data))
            .catch(error => console.error("Error fetching zones:", error));

        fetch("/zonebuilder/get_parent_zones")  // âœ… Fetch parent zones
            .then(response => response.json())
            .then(data => setParentZones(data.zones))
            .catch(error => console.error("Error fetching parent zones:", error));
    }, []);

    // âœ… Map selection fix (ensure correct API response structure)
    const handleMapChange = (e) => {
        setSelectedMapId(e.target.value);
    };

    // âœ… Zone selection fix (ensure correct API response structure)
    const handleZoneChange = (e) => {
        setSelectedZoneType(e.target.value);
    };

    // âœ… Parent zone selection fix
    const handleParentZoneChange = (e) => {
        setSelectedParentZone(e.target.value);
    };

    const saveZone = async () => {
        const zoneVertices = [];
        drawnItems.current.eachLayer(layer => {
            if (layer instanceof L.Polygon) {
                layer.getLatLngs()[0].forEach(point => {
                    zoneVertices.push({ n_x: point.lng, n_y: point.lat, n_z: 0 });
                });
            }
        });

        const zoneData = {
            zone_name: zoneName,
            map_id: selectedMapId,
            zone_level: selectedZoneType,
            parent_zone_id: selectedParentZone,
            vertices: zoneVertices,
        };

        try {
            const response = await fetch("/zonebuilder/create_zone", {  // ðŸ”¥ Fix: Change `/api/create_zone`
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify(zoneData),
            });

            const result = await response.json();
            if (response.ok) {
                alert(`Zone '${zoneName}' created successfully!`);
            } else {
                alert(`Error: ${result.detail}`);
            }
        } catch (error) {
            console.error("Error creating zone:", error);
            alert("Failed to create zone");
        }
    };

    return (
        <div>
            <h2>Zone Builder</h2>

            <label>Zone Type:</label>
            <select onChange={handleZoneChange}>
                <option value="">Select Zone Type</option>
                {zones.map(zone => (
                    <option key={zone.zone_level} value={zone.zone_level}>{zone.zone_name}</option>
                ))}
            </select>

            <label>Map:</label>
            <select onChange={handleMapChange}>
                <option value="">Select Map</option>
                {maps.map(map => (
                    <option key={map.map_id} value={map.map_id}>{map.name}</option>  // âœ… Fix: Correct keys
                ))}
            </select>

            <label>Parent Zone:</label>
            <select onChange={handleParentZoneChange}>
                <option value="">(None - Parent Zone)</option>
                {parentZones.map(zone => (  // âœ… Populate Parent Zones
                    <option key={zone.zone_id} value={zone.zone_id}>{zone.name}</option>
                ))}
            </select>

            <label>Zone Name:</label>
            <input type="text" value={zoneName} onChange={(e) => setZoneName(e.target.value)} placeholder="Enter Zone Name" />

            <label>Render with Leaflet:</label>
            <input type="checkbox" checked={useLeaflet} onChange={(e) => setUseLeaflet(e.target.checked)} />

            {useLeaflet ? <div id="zoneMap" style={{ height: "500px", width: "100%" }}></div> : <Map zoneId={selectedMapId} onDrawComplete={setVertices} useLeaflet={false} />}

            <button onClick={saveZone}>Save Zone</button>
        </div>
    );
};

export default ZoneBuilder;
